import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Nav from './Componet/Nav';
import LearnMor from './Componet/LearnMor';
import AddBlog from './Componet/AddBlog';
import Home from './Componet/Dashboard';
import Dashboard from './Componet/Dashboard';
import BlogBox from './Componet/BlogBox';
function App() {
  return (
    <>
      <BrowserRouter>
        <Nav />
        <Routes>


          <Route path='/nav' element={ <  Nav /> } />
          <Route path='/blogbox' element={ <  BlogBox /> } />

          <Route path='/add-blog' element={ <AddBlog /> } />
          <Route path='/home' element={ <Dashboard /> } />

        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
